define('views/subs',["knockout", "knockoutMapping"], function (ko, komapping) {
    ko.mapping = komapping;
    var self = null;
 
    var createHandlers = function () {

        $("#btnWhereIsMyChurch").on(gdd.tap(), function () {
            gdd.showPopup("popupAddMyChurchNews")

        });


      

        $("#btnSubsRefresh").on(gdd.click(), function () {
            self.subs.removeAll();
            gdd.showLoader("Loading subscriptions...")
            getSubsProfile(
                function () {
                    gdd.hideLoader();
                    configureSubsDisplay();
                },
                function (err) {
                    gdd.hideLoader();
                    gdd.showErr(err)
                })
        })

        


    }


   var getSubsProfile= function ( complete, fail) {

        var updateSubsBinding = function () {
            $(".portalSubsFlipSwtch").flipswitch();
            $(".portalSubsFlipSwtch").flipswitch("refresh")
           

            var togglePortalSubs = function (portalId,portalName, subscribe, sendEmail, loadingText) {

                gdd.showLoader(loadingText)

                var obj = {}
                obj.personId = gdd.session.personId();
                obj.portalId = portalId;
                obj.subscribed = subscribe;
                obj.sendEmail = sendEmail;
                obj.portalName = portalName;
             
                gdd.api.callApi("News/UpdatePersonPortalNewsSubscription", "POST", obj, {
                    "success": function (obj) {
                       gdd.hideLoader()

                        var arr = $.grep(self.subs(), function (elem, i) {
                            return elem.portalId == portalId;
                        })

                        var idx = self.subs.indexOf(arr[0])
                        self.subs.splice(idx, 1)
                        self.subs.splice(idx, 0, obj.gddData)


                        updateSubsBinding();
                    },
                    "fail": function (obj) {
                        gdd.hideLoader();
                        gdd.showErr(obj.msg)
                    }
                })


            }

            $(".btnSubscribeToPortal").on(gdd.tap(), function () {
                var portalId = $(this).attr("data-id")
                var portalName = $(this).attr("data-name")

              gdd.pages.news.view.newsItems.removeAll()

                togglePortalSubs(portalId,portalName, true, true, "Subscribing...")
             

            })

            $(".btnUnSubscribeFromPortal").on(gdd.tap(), function () {
                var portalId = $(this).attr("data-id")
                var portalName = $(this).attr("data-name")

                gdd.pages.news.view.newsItems.removeAll()

                togglePortalSubs(portalId,portalName, false, false, "Unsubscribing...")               

            })

            $(".portalSubsFlipSwtch").on("change", function () {
                var portalId = $(this).attr("data-id")
                var portalName = $(this).attr("data-name")
                var sendEmail = $(this).prop("checked")

                if (sendEmail) {
                    togglePortalSubs(portalId, portalName, true, sendEmail, "Adding email...")

                } else {
                    togglePortalSubs(portalId, portalName, true, sendEmail, "Removing email...")

                }                             

            })

            complete()

        }

        var reload = false;

        if (self.subs().length === 0) {
            reload = true;
        } 


        if (reload) {

            gdd.api.callApi("News/GetPersonsSubsProfile", "GET", { "personId": gdd.session.personId }, {
                "success": function (obj) {
                    
                    self.subs.removeAll()                   

                    if ($.isArray(obj.gddData)) {
                        if (obj.gddData.length > 0) {
                            var subsCache = obj.gddData;                         

                            $.each(subsCache, function (s, sub) {
                                self.subs.push(sub)
                            });

                            updateSubsBinding()
                        }
                    }

                },
                "fail": function (obj) {
                    fail(obj.msg)
                }
            })

        } else {
            updateSubsBinding();
            complete();
        }


   }

   var configureSubsDisplay = function () {

       if (gdd.pages.subs.view.subs().length > 0) {
           $("#noSubsItems").hide()
           $("#subsItems").fadeIn()
       } else {
           $("#subsItems").hide()
           $("#noSubsItems").fadeIn()
       }
   }


    return {
        subs:ko.observableArray(),
        create: function () {
            self = this;
            gdd.utils.configMergeFromJs(ko);
            createHandlers();
       
                ko.applyBindings(gdd, document.getElementById(gdd.utils.activePage.id));
             
         

        },
        show: function () {

            gdd.showLoader("Loading subscriptions...")
            getSubsProfile(
                function () {
                    gdd.hideLoader();
                    configureSubsDisplay();
                },
                function (err) {
                    gdd.hideLoader();
                    gdd.showErr(err)
                })

        },
        beforeShow: function () { },
        beforeHide: function () { },
        endOldSession: function () { }


    }


});


define('views/people',["knockout", "knockoutMapping"], function (ko, komapping) {
    ko.mapping = komapping;
    var self = null;
    var viewSelector = {
        all: ".peopleView",
        addNew: ".peopleAddNewView",
        search: ".peopleSearchView",
        duplicates: ".peopleDuplicateView",
        selectedPerson: ".selectedPersonView"

    }

    var slideTransitionView = function (toElem, direction, clb) {
        gdd.utils.slideTransitionView($(viewSelector.all), $(toElem), direction, function () {
          

            switch (toElem) {
                case viewSelector.addNew:
                    $("#peopleHeader").html("Add New")
                    break;

                case viewSelector.search:
                    $("#peopleHeader").html("Search")

                    break;
                case viewSelector.duplicates:
                    $("#peopleHeader").html("Duplicates?")

                    break;

                case viewSelector.selectedPerson:
                    $("#peopleHeader").html("Person")

                    //if (self.clb) {
                    //    $("#btnPeopleMapExisting").show();
                    //} else {
                    //    $("#btnPeopleMapExisting").hide();
                    //}

                    break;

            }

            if (clb) {
                clb()
            }

        })

    }

    var updateSearchBinding = function () {

        
        $(".btnPeopleSearchView").off().on(gdd.tap(), function () {
            var id = $(this).attr("data-id");
            var arr = $.grep(self.people(), function (elem, i) {
                return elem.id == id;
            })
            self.selectedPerson.id(arr[0].id);
            self.selectedPerson.firstName(arr[0].firstName);
            self.selectedPerson.lastName(arr[0].lastName);
            self.selectedPerson.email(arr[0].email);
            self.selectedPerson.mobileNumber(arr[0].mobileNumber);
            self.selectedPerson.fbId(arr[0].facebookId);
            self.selectedPerson.fbPicUrl("https://graph.facebook.com/" + arr[0].facebookId + "/picture?type=large");

            $(".selectedPersonViewBack").one(gdd.tap(), function () {
                slideTransitionView(viewSelector.search, "right")
            });
            $("#selectPersonText").html("Select this person")


            slideTransitionView(viewSelector.selectedPerson, "left")
        });

        $(".btnPeopleSearchSelect").off().on(gdd.tap(), function () {
            var id = $(this).attr("data-id");
            var arr = $.grep(self.people(), function (elem, i) {
                return elem.id == id;
            })
            self.selectedPerson.id(arr[0].id);
            self.selectedPerson.firstName(arr[0].firstName);
            self.selectedPerson.lastName(arr[0].lastName);
            self.selectedPerson.email(arr[0].email);
            self.selectedPerson.mobileNumber(arr[0].mobileNumber);
            self.selectedPerson.fbId(arr[0].facebookId);
            self.selectedPerson.fbPicUrl("https://graph.facebook.com/" + arr[0].facebookId + "/picture?type=large");

            

            if (gdd.pages.people.view.clb) {
                gdd.pages.people.view.clb(ko.mapping.toJS(self.selectedPerson))
            } else {
                $(".selectedPersonViewBack").one(gdd.tap(), function () {
                    slideTransitionView(viewSelector.search, "right")
                });
                $("#selectPersonText").html("Select this person")
                slideTransitionView(viewSelector.selectedPerson, "left")
            }


        })


    }

   

    var createHandlers = function () {

        $("#btnPeopleMapExisting").on(gdd.click(), function (event) {


            gdd.showLoader("")
            gdd.api.callApi("Person/MapPerson", "GET", { "personId": self.selectedPerson.id() }, {
                "success": function (obj) {
                    gdd.hideLoader();
                    if (self.clb) {
                        self.clb(ko.mapping.toJS(self.selectedPerson))
                    } else {
                        slideTransitionView(viewSelector.search, "right")
                    }
                  
                },
                "fail": function (obj) {
                    gdd.hideLoader();
                    gdd.showErr(obj.msg)
                }
            })



        });
        
        
        $("#btnDuplicateNotHere").on(gdd.tap(), function () {
            self.newPerson.skipDupCheck("1")

            addPerson(
                function (result) {
                    self.selectedPerson.id(result.id);
                    self.selectedPerson.firstName(result.firstName);
                    self.selectedPerson.lastName(result.lastName);
                    self.selectedPerson.email(result.email1);
                    self.selectedPerson.mobileNumber(result.mobileNumber);
                    self.selectedPerson.fbId(result.facebookId);
                    self.selectedPerson.fbPicUrl(result.facebookProfilePicLg);

                    if (self.clb) {
                        self.clb(ko.mapping.toJS(self.selectedPerson))
                    } else {
                        slideTransitionView(viewSelector.search, "right")
                    }
                   
                },
                function (results) {
                    slideTransitionView(viewSelector.duplicates, "left", function () {
                        gdd.showPopup("popupDupFound")
                    })
                },
                function (err) {
                    gdd.showErr(err)
                })
        });
        

        $(".peopleDupViewBack").on(gdd.tap(), function () {
            slideTransitionView(viewSelector.addNew, "right")
        });
        
        $("#btnPersonBackToAdd").on(gdd.tap(), function () {
            slideTransitionView(viewSelector.addNew, "right")
        });

        $("#btnAddPerson").on(gdd.tap(), function () {
            self.newPerson.skipDupCheck("0")
           
            addPerson(
                function (result) {                  
                    self.selectedPerson.id(result.id);
                    self.selectedPerson.firstName(result.firstName);
                    self.selectedPerson.lastName(result.lastName);
                    self.selectedPerson.email(result.email1);
                    self.selectedPerson.mobileNumber(result.mobileNumber);
                    self.selectedPerson.fbId(result.facebookId);
                    self.selectedPerson.fbPicUrl(result.facebookProfilePicLg);

                    self.clb(ko.mapping.toJS(self.selectedPerson))
                },
                function (results) { 
                    slideTransitionView(viewSelector.duplicates, "left", function () {
                        gdd.showPopup("popupDupFound")
                    })
                },
                function (err) {                   
                    gdd.showErr(err)
                })
        })

        $(".btnAddNewPerson").on(gdd.tap(), function () {
           slideTransitionView(viewSelector.addNew,"up")
        })

        $(".btnSearchPerson").on(gdd.tap(), function () {
            slideTransitionView(viewSelector.search, "down")
        })

        
        $("#peopleList").on("filterablebeforefilter", function (e, data) {

            
            var $ul = $(this),

            $input = $(data.input),
            value = $input.val();
    
            var qry = {};
            qry.scopeGlobal = false;
            qry.scopeOrg = false;
            qry.searchString=value

            if (value && value.length > 2) {
              gdd.showLoader("Searching...")
                gdd.api.callApi("Person/QuickSearch", "POST", qry, {
                    "success": function (obj) {
                        gdd.hideLoader();
                        var response = obj.gddData;
                        self.people.removeAll();
                        $.each(response, function (i, elem) {

                            self.people.push(elem);
                         
                        });
                   
                        $ul.listview("refresh");
                        $ul.trigger("updatelayout");
                        updateSearchBinding()

                    },
                    "fail": function (obj) {
                        gdd.hideLoader();
                        gdd.showErr(obj.msg)
                    }
                })

            }
        });
    };
     
    var addPerson = function (personAdded, duplicatesFound, fail) {

        var pobj = ko.mapping.toJS(self.newPerson)

        if ((pobj.firstName) && (pobj.lastName)) {

            if ((!pobj.email1) && (!pobj.mobileNumber)) {
                gdd.showMsg("You provide either a mobile number or email address or both.")
            } else {
                gdd.showLoader("Adding...")
                gdd.api.callApi("Person/AddPerson", "POST", ko.mapping.toJS(self.newPerson), {
                    "success": function (result) {
                        gdd.hideLoader();
                        if (result.gddData.resultCode == "1") {
                            personAdded(result.gddData.results[0])
                        } else {

                            self.duplicates.removeAll()
                            $.each(result.gddData.results, function (i, elem) {
                                self.duplicates.push(elem)
                            })

                            $(".selectDuplicate").off().on(gdd.tap(), function () {
                                var id = $(this).attr("data-id");
                                var arr = $.grep(self.duplicates(), function (elem, i) {
                                    return elem.id == id;
                                })
                                self.selectedPerson.id(arr[0].id);
                                self.selectedPerson.firstName(arr[0].firstName);
                                self.selectedPerson.lastName(arr[0].lastName);
                                self.selectedPerson.email(arr[0].email1);
                                self.selectedPerson.mobileNumber(arr[0].mobileNumber);
                                self.selectedPerson.fbId(arr[0].facebookId);
                                self.selectedPerson.fbPicUrl(arr[0].facebookProfilePicLg);

                                $(".selectedPersonViewBack").one(gdd.tap(), function () {
                                    slideTransitionView(viewSelector.duplicates, "right")
                                });
                                $("#selectPersonText").html("This is the person")

                                


                                slideTransitionView(viewSelector.selectedPerson, "left")
                            })


                            $("#peopleDuplicateList").listview("refresh")

                            duplicatesFound()
                           
                        }
                    },
                    "fail": function (obj) {
                        gdd.hideLoader();
                        fail(obj.msg)
                    }
                })
            }

        } else {
            gdd.showMsg("You must provide both a first and last name.")
        }

       

    }

    
    return {
        duplicates:ko.observableArray(),
        newPerson: {
            id: ko.observable("-1"),
            firstName: ko.observable("Andrew"),
            lastName: ko.observable("Hunter"),
            mobileNumber: ko.observable("444444"),
            email1: ko.observable("sdsdsd@ddd.com"),
            skipDupCheck:ko.observable("0")
        },
        clb:null,
        selectedPerson: {
            id: ko.observable(''),
            firstName: ko.observable(''),
            lastName: ko.observable(''),
            email: ko.observable(''),
            mobileNumber: ko.observable(''),
            fbId: ko.observable(''),
            fbPicUrl:ko.observable('')
        },
      
        people:ko.observableArray(),
        create: function () {
            self = gdd.utils.activePage.view;
            gdd.utils.configMergeFromJs(ko);
            createHandlers();

            ko.applyBindings(gdd, document.getElementById(gdd.utils.activePage.id));

        },
        show: function () {

            if (self.people().length > 0) {
                $("#peopleList").listview("refresh");
                $("#peopleList").trigger("updatelayout");
                updateSearchBinding();
            }
        },
        beforeShow: function () { },
        beforeHide: function () {
            gdd.pages.people.clb = null;
        },
        endOldSession: function () {
            gdd.pages.people.view.people.removeAll();
            gdd.pages.people.view.duplicates.removeAll();

        }
    }
});







