    var updateGroup = function (success, fail) {

        var record = ko.mapping.toJS(self.selectedGroup);

        gdd.api.callApi("Groups/UpdateGroup", "POST", record, {
            "success": function (obj) {
                gdd.hideLoader();
                var result = obj.gddData[0];
                var arr = $.grep(self.groups(), function (elem, i) {
                    return (elem.id == result.id);
                });
                var idx = 0
                if (arr.length > 0) {
                    idx = self.groups.indexOf(arr[0]);
                    self.groups.splice(idx, 1);
                }
                self.groups.splice(idx, 0, result);
                updateGroupListBinding();
                success()

            },
            "fail": function (obj) {
                fail(obj.msg);
            }
        })

    }
   
    var loadGroupMembers = function (success, fail) {

        if (self.selectedGroup.members().length > 0) {
            success()
        } else {
            gdd.api.callApi("Groups/GetGroupMembers", "GET", { "groupId": self.selectedGroup.id() }, {
                "success": function (obj) {

                    self.selectedGroup.members.removeAll()

                    var source = self.selectedGroup.sourceRecord()
                    if (!source.members) {
                        source.members = new Array();
                    }
                    source.members.length = 0;
                    $.each(obj.gddData, function (i, elem) {
                        self.selectedGroup.members.push(elem);
                        source.members.push(elem);
                    })

                    success();
                },
                "fail": function (obj) {
                    fail(obj.msg)
                }
            })
        }



    }

    var toggleGroupMemberStatus = function (personId, groupId, isActive, deReasonId, deMI, success, fail) {
        var data = {}
        data.personId = personId;
        data.groupId = groupId;
        data.isActive = isActive;
        data.inActiveReasonId = deReasonId
        data.moreInfo = deMI;

        gdd.api.callApi("Groups/UpdateGroupMemberStatus", "POST", data, {
            "success": function (obj) {
                var result = obj.gddData[0];

                var arr = $.grep(self.selectedGroup.members(), function (elem, i) {
                    var incl = false;
                    if (elem.id == result.id) {
                        incl = true;
                    } else {
                        if (elem.personId == result.personId) {
                            incl = true;
                        }
                    }
                    return incl
                });

                var idx = 0
                if (arr.length > 0) {
                    $.each(arr, function (i, elem) {
                        idx = self.selectedGroup.members.indexOf(elem);
                        self.selectedGroup.members.splice(idx, 1);
                    });
                }

                self.selectedGroup.members.splice(idx, 0, result);


                $(".membersListView").listview("refresh");

                updateGroupMembersBinding()

                self.selectedGroupSession.attendance.removeAll();
                $.each(self.groups, function (i, elem) {
                    if (elem.sessions) {
                        $.each(elem.sessions, function (s, session) {
                            if (session.attendance) {
                                session.attendance.length = 0
                            }
                        })
                    }


                });

                success()
            },
            "fail": function (obj) {
                fail(obj.msg)
            }
        })

    }

 


   

  

