define('views/managepermissions',["knockout", "knockoutMapping"], function (ko, komapping) {
    ko.mapping = komapping;
    var self = null;
    var selectedRequestId = null;

    var grantRequest = function (instruction) {
   

        gdd.showLoader("Working...")
        gdd.api.callApi("Security/GrantPermission", "GET", {"requestId":selectedRequestId,"instruction":instruction}, {
            "success": function (result) {
                gdd.hideLoader();
                var arr = $.grep(self.requests(), function (elem,i) {
                    return elem.id==selectedRequestId
                })
                self.requests.splice(self.requests.indexOf(arr[0]), 1)
                if (self.requests().length === 0) {
                    loadRequests()
                }
            },
            "fail": function (result) {
                gdd.hideLoader();
                gdd.showErr(result.msg)
            }
        })

    };

    var createHandlers = function () {


        $("#btnPermReqTrusted").on(gdd.tap(), function () {            
            $("#popupPermReqMenu").one("popupafterclose", function (event, ui) {
                grantRequest(1)
            });
            $("#popupPermReqMenu").popup("close")
        });

        $("#btnPermReqExecutive").on(gdd.tap(), function () {            
            $("#popupPermReqMenu").one("popupafterclose", function (event, ui) {
                grantRequest(2)
            });
            $("#popupPermReqMenu").popup("close")
        });

        $("#btnPermReqPublic").on(gdd.tap(), function () {            
            $("#popupPermReqMenu").one("popupafterclose", function (event, ui) {
                grantRequest(0)
            });
            $("#popupPermReqMenu").popup("close")
        });
        $("#btnPermReqDelete").on(gdd.tap(), function () {            
            $("#popupPermReqMenu").one("popupafterclose", function (event, ui) {
                grantRequest(-1)
            });
            $("#popupPermReqMenu").popup("close")
        });

        $("#btnCheckForNewRequests").on(gdd.tap(), function () {
            self.requests.removeAll();
            loadRequests()

        });


    };
    
    var loadRequests = function () {

        var updateBinding = function () {

            $(".btnPermissionOption").off().on(gdd.click(), function () {
                selectedRequestId = $(this).attr("data-id");
                gdd.showPopup("popupPermReqMenu", { "positionTo": $(this) });
            });

        }

        if (self.requests().length > 0) {
            updateBinding()
        } else {
            gdd.showLoader("Loading...")

            
            gdd.api.callApi("Security/GetPermissionRequests", "GET", '', {
                "success": function (result) {
                    gdd.hideLoader();

                    if (result.gddData.length > 0) {
                        $.each(result.gddData, function (i,elem) {
                            self.requests.push(elem)
                        })
                        updateBinding()
                    } else {
                        gdd.showMsg("All pending requests have been handled.", function () {
                            $(".btnBackToPrevPage").trigger(gdd.click())
                        })
                    }

                },
                "fail": function (result) {
                    gdd.hideLoader();
                    gdd.showErr(result.msg)
                }
            })

        }

    }




    return {
        requests:ko.observableArray(),
        create: function () {
            self = gdd.utils.activePage.view;
            gdd.utils.configMergeFromJs(ko);
            createHandlers();

            ko.applyBindings(gdd, document.getElementById(gdd.utils.activePage.id));



        },
        show: function () {
            loadRequests()
        },
        beforeShow: function () { },
        beforeHide: function () { },
        endOldSession: function () {
          gdd.pages.managePermissions.view.requests.removeAll();
        },


    }


});








