        slideTransitionView: function (allElem, toElem, direction, clb) {

            var reverse = "up"
            switch (direction) {
                case "up":
                    reverse = "down";
                    break;
                case "left":
                    reverse = "right";
                    break;

                case "right":
                    reverse = "left";
                    break;

                case "down":
                    reverse = "up";
                    break;

            }

            $.when($(allElem).not($(toElem)).hide("slide", { "direction": direction })).then(function () {
                $.when($(toElem).show("slide", { "direction": reverse })).then(function () {
                    if (clb) {
                        clb()
                    }
                })
            })


        },
