define('global/api',[],function () {


    var apiBaseUrl = function () {
        if (gdd.session.baseApiUrl) {
            // return "http://localhost/webapi2/api/"
            // return gdd.session.baseApiUrl
            // return "http://192.168.0.2/webapi2/api/"
            return "http://41.86.98.79/webapi2/api/"
        } else {
            // return "http://localhost/webapi2/api/"
            //return "http://192.168.0.2/webapi2/api/"
            // return "http://api.gododata.com/webapi2/api/"
            return "http://41.86.98.79/webapi2/api/"

        }
    }


    var apiHeaders = function () {

        var sessKey = gdd.session.sessionKey()

        if (sessKey) {
            return { "apiKey": gdd.session.apiKey, "usrKey": sessKey, "appInfo": gdd.session.appInfo }
        } else {
            var authKey = gdd.session.authKey()
            if (authKey) {
                return { "apiKey": gdd.session.apiKey, "usrKey": authKey, "appInfo": gdd.session.appInfo }
            } else {
                return { "apiKey": gdd.session.apiKey, "usrKey": "", "appInfo": gdd.session.appInfo }

            }
        }

    }





    return {
       

        callApi: function (apiMethod, verb, data, clb) {


            $.support.cors = true;



            if ((clb.success) && (clb.fail)) {
                var source = apiBaseUrl() + apiMethod;


                $.ajax(source, {
                    type: verb,
                    headers: apiHeaders(),
                    data: data,


                    complete: function (jqxhr, status) {
                        var obj = {}
                        obj.status = jqxhr.status;

                        if (jqxhr.responseJSON) {
                            obj.gdd = jqxhr.responseJSON;
                        } else {
                            if (jqxhr.responseText) {
                                try {
                                    obj.gdd = JSON.parse(jqxhr.responseText)
                                }
                                catch (e) {
                                    obj.gdd = obj.gdd || {};

                                    obj.gdd.msg = "The response from the server has been tampered with. Please contact support."
                                    clb.fail(obj.gdd)
                                    return;
                                }

                            } else {
                                //gdd.app.signOut()
                                if ((obj.status === 404)) {
                                    obj.gdd = obj.gdd || {};

                                    obj.gdd.msg = "HTTP ERROR: You are not permitted to access this api endpoint. If you think this is an error please contact support."
                                } else {
                                    if (obj.status == "0") {
                                        obj.gdd = obj.gdd || {};

                                        obj.gdd.msg = "INTERNET CONNECTION: Your internet connection has been lost. Please reconnect and try again."
                                    } else {
                                        obj.gdd = obj.gdd || {};

                                        obj.gdd.msg = "The response from the server has been tampered with. Please contact support."
                                    }


                                }

                                clb.fail(obj.gdd)
                                return;
                            }

                        }



                        //window.gdd = window.gdd || {};

                        if ((obj.status === 404) || obj.status == "0") {

                            //gdd.app.signOut()
                            obj.gdd = obj.gdd || {};

                            obj.gdd.msg = "HTTP ERROR: You are not permitted to access this api endpoint. If you think this is an error please contact support."
                            clb.fail(obj.gdd)

                        } else {
                            if (obj.gdd.code) {

                                switch (obj.gdd.code) {

                                    case 1000: //success
                                        clb.success(obj.gdd)

                                        break;

                                    case 1001: //to many records
                                        clb.success(obj.gdd, obj.gdd.codesc)

                                        break;

                                    case 4000: //validation
                                        obj.gdd.msg = "VALIDATION ERROR: " + obj.gdd.msg

                                        if (clb.validation) {
                                            clb.validation(obj.gdd)

                                        } else {
                                            clb.fail(obj.gdd)
                                        }

                                        break;

                                    case 4002:
                                        gdd.session.signOut();

                                        break;

                                    case 4001: //access denied
                                        obj.gdd.msg = "ACCESS DENIED: " + obj.gdd.msg

                                        clb.fail(obj.gdd)
                                        break;

                                    case 5000: //server error
                                        obj.gdd.msg = "SERVER ERROR: " + obj.gdd.msg
                                        clb.fail(obj.gdd)
                                        break;

                                    case 5001: //general error
                                        obj.gdd.msg = "ERROR: " + obj.gdd.msg
                                        clb.fail(obj.gdd)
                                        break;

                                }

                            }
                            else {
                                obj.gdd = obj.gdd || {};
                                obj.gdd.msg = "The response from the server was not correctly formatted. Please contact support."
                                clb.fail(obj.gdd)

                            }
                        }

                    }

                });


            } else {
                throw "You must provide a valid callback for 'success' and 'failed'"
            }

        }

    }


});
define('global/storage',[],function () {
    


    var getData = function (dataKey, dataStore) {
        
        var data = dataStore.getItem(dataKey);

        if (!data) {
            dataStore.removeItem(dataKey);
            return null;
        }
        else {
            try {
                return $.parseJSON(data);
            }
            catch (err) {
                dataStore.removeItem(dataKey);
                return null;
            }

        }
    }

    var saveData = function (data, dataKey, dataStore) {
        if (!data) {
            dataStore.removeItem(dataKey);
        }
        else {
            dataStore.setItem(dataKey, JSON.stringify(data));
        }
    }

    //glb-global variable, ses-session
    var keyAuthKey = "glb_authkey"
    var keySessionKey = "ses_authkey"
    var keyGrpRefData = "ses_grpref_"
    var keyAccount = "ses_account"
    var keyEventRegCache = "perm_evregcache" //persist these beyond a sign out
    var keyFindChurchGeoStructure="glb_facgeostruc"
    return {
      

        signOut: function () {

            //localStorage.clear();
            //sessionStorage.clear();

            var keysToRemove = new Array;
            for (var i = 0; i < localStorage.length; i++) {
                var pref = localStorage.key(i).split("_")[0];
                if (pref != "perm") {
                    keysToRemove.push(localStorage.key(i));
                }

            }
            $.each(keysToRemove, function (i, value) {
                localStorage.removeItem(value);
            });

            keysToRemove.length = 0;
            for (var i = 0; i < sessionStorage.length; i++) {

                var pref = sessionStorage.key(i).split("_")[0];
                if (pref != "perm") {
                    keysToRemove.push(sessionStorage.key(i));
                }

            }

            $.each(keysToRemove, function (i, value) {
                sessionStorage.removeItem(value);
            });
        },

     



        getAuthInfo: function () {
            return getData(keyAuthKey, localStorage);
        },

        saveAuthInfo: function (data) {
            saveData(data, keyAuthKey, localStorage);

        },

        getSessionInfo: function () {
            return getData(keySessionKey, localStorage);
        },

        saveSessionInfo: function (data) {
            saveData(data, keySessionKey, localStorage);

        },

        getGrpRefData: function () {
            return getData(keyGrpRefData + gdd.session.activeSession.portalId(), localStorage);
        },

        saveGrpRefData: function (data) {
            saveData(data, keyGrpRefData + gdd.session.activeSession.portalId(), localStorage);

        },

        getAccountData: function () {
            return getData(keyAccount, localStorage);
        },

        saveAccountData: function (data) {
            saveData(data, keyAccount, localStorage);

        },

        getEventRegCache: function () {

            return getData(keyEventRegCache, localStorage);

        },

        saveEventRegCache: function (data) {
            saveData(data, keyEventRegCache, localStorage);
        },

        getFacGeoStruc: function () {
            return getData(keyFindChurchGeoStructure, localStorage);
        },

        saveFacGeoStruc: function (data) {
            saveData(data, keyFindChurchGeoStructure, localStorage);

        },


    }


});
