define('global/nms',["views/views",
"global/session",
"global/utils",
"global/api",
"global/storage",
"global/cache"], function (views, ses, utls, api, stg,cac) {

  



    return {
        cache:cac,
        pages: views,
        session: ses,
        utils: utls,
        api: api,
        storage:stg,
        
        permissions: function () {
            if (gdd.session) {
                if (gdd.session.activeSession) {
                    return gdd.session.activeSession.permissions;
                } else {
                    return null;
                }
            } else {
                return null;
            }
        },
        loadPage: function (page, reverse,type) {
            utls.loadPage(page, reverse,type)
        },

        portalId: function () {
            return gdd.session.activeSession.portalId();
        },
        portalName: function () {
          return  gdd.session.activeSession.portalName();
        },

        tap: function () {
            return utls.tap;
        },
        click: function () {
            return utls.click;
        },
        showMsg: function (msg,clb) {
            utls.showMsg(msg,clb);
        },

        showWarning: function (msg, clb) {
            utls.showWarning(msg, clb);
        },
        showErr: function (err,clb) {
            utls.showErr(err,clb);
        },
        showPopup: function (elemId,options) {
            utls.showPopup(elemId,options);

        },
    
       
        
        hideLoader: function () {
            utls.hideLoader()
        },
        showLoader: function (text) {

            utls.showLoader(text)
        }
       


    }


});











